identifierTypes :: Char -> Int
identifierTypes c
    -- Planes 0-3
    | cp < 0x3347A = lookupIdentifierTypesBitMap cp
    -- Planes 4-13: 0
    | cp < 0xE0000 = 0
    -- Plane 14
    | cp < 0xE01F0 = lookupIdentifierTypesBitMap (cp - 0xACB86)
    -- Default: 0
    | otherwise = 0
    where
    cp = ord c

